import BlackRectangle from "./BlackRectangle";

const t1 = [
  "I can’t recommend this podcast enough",
  "Jacob is the best in the business",
  "A wealth of audio knowledge",
  "Every episode is a gem!",
  "Whoa whoa, let me take some notes!",
  "Whoa whoa, let me take some notes!",
];
const t2 = [
  "Betty Lacey",
  "Adam Driver",
  "Marcus Brown",
  "Jessica Knowl",
  "Scott Adams",
  "Steven Blast",
];

const Section4 = () => {
  return (
    <section>
      <div>
        <BlackRectangle />
        <BlackRectangle />
        <BlackRectangle />
      </div>
      <div>
        <BlackRectangle />
        <BlackRectangle />
        <BlackRectangle />
      </div>
    </section>
  );
};

export default Section4;
